    blert = blert*2;
    blackberry = parseFloat(bolance);
}
if (bolance<(blackberry-(blert*uniq))){
    blert = blert*2;
    uniq = 4.5;
    oniq = 4.5;
    fart = 0;
    blackberry = parseFloat(bolance);
}
if (bolance<(strawberry-lemon)){
blueberry = parseFloat(strawberry);
}
if ((bolance<=(blert*80))&&(bolance<(((Math.floor(bolance/lemon))*lemon)+burger))) { 
    blert = nudle;
    oniq = 6.5;
    uniq = 2.5;
    blackberry = ((Math.floor((parseFloat(bolance))/lemon))*lemon);
}
if ((bolance>=(blueberry+(lemon*3)))&&(bolance<(((Math.floor(bolance/lemon))*lemon)+burger))) { 
    blert = nudle;
    oniq = 6.5;
    uniq = 2.5;
    blackberry = ((Math.floor((parseFloat(bolance))/lemon))*lemon);
    blueberry = ((Math.floor((parseFloat(bolance))/lemon))*lemon);
}
if ((bolance>=(strawberry+(nudle*100)))&&(bolance<(((Math.floor(bolance/lemon))*lemon)+burger))) { 
    nudle = Number(((parseFloat(bolance))/1000).toFixed(8));
    blert = nudle;
    oniq = 6.5;
    uniq = 2.5;
    lemon = (nudle*10);
    burger = (nudle*6.5);
    blackberry = ((Math.floor((parseFloat(bolance))/lemon))*lemon);
    blueberry = ((Math.floor((parseFloat(bolance))/lemon))*lemon);
    strawberry = ((Math.floor((parseFloat(bolance))/lemon))*lemon);
}
    if (bolance>=teget) {
        console.log("winner winner chicken dinner");
        return;
    }
razzle = (blert*1).toFixed(8);
$('#pct_chance').val(chan);
$('#pct_payout').val(paymout);
$('#pct_bet').val(razzle);
$('#a_lo').click();
var good = ((bolance-smiley).toFixed(8));
console.log("profit");
console.log(good);
setTimeout(() => get(), 1);
}
