void swap(int* a, int* b) {
	int tmp = *a;
	*a = *b;
	*b = tmp;
}

void moveNegsToStart(int n, int arr[]) {
	int j = 0;
	while (arr[j] < 0) {
		j++;
	}
	for (int i = j + 1; i < n; i++) {
		if (arr[i] < 0) {
			swap(&arr[i], &arr[j]);
			j++;
			while (arr[j] < 0) {
				j++;
			}
		}
	}
}

